import React, { useRef } from "react";
import { motion, useScroll, useTransform, useSpring, useInView } from "framer-motion";

const OtherP: React.FC = () => {
  const { scrollY } = useScroll();
  const scrollX = useTransform(scrollY, [0, 400], [0, -200]);
  const xSpring = useSpring(scrollX, { stiffness: 100, damping: 30 });
  
  // Add ref for hero section
  const heroRef = useRef(null);
  const heroInView = useInView(heroRef, { once: true, amount: 0.3 });

  return (
    <div className="min-h-screen bg-[#F4F1EC]">
      {/* Hero Section */}
      <motion.section 
        ref={heroRef}
        className="relative w-full min-h-[100vh] h-screen overflow-hidden"
        initial={{ opacity: 0 }}
        animate={{ opacity: heroInView ? 1 : 0 }}
        transition={{ duration: 1 }}
      >
        <div className="absolute top-[40vh] w-full overflow-hidden">
          <motion.div 
            className="whitespace-nowrap"
            initial={{ x: "100%" }}
            animate={{ x: "-100%" }}
            transition={{
              duration: 20,
              repeat: Infinity,
              ease: "linear"
            }}
          >
            <span className="text-[15vw] font-serif font-bold">PROJECTS&nbsp;&nbsp;PROJECTS&nbsp;&nbsp;PROJECTS&nbsp;&nbsp;</span>
          </motion.div>
        </div>

        <div className="absolute inset-0 flex items-center justify-center">
          <motion.div
            className="relative z-50"
            animate={{
              y: [0, -20, 0],
              scale: [1, 1.1, 1],
            }}
            transition={{
              duration: 4,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          >
            <motion.p 
              className="text-xl text-gray-600 max-w-2xl mx-auto text-center"
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.5 }}
            >
              A collection of my creative works spanning branding, web games, and interactive experiences
            </motion.p>
          </motion.div>
        </div>
        <div className="absolute bottom-0 left-0 right-0 h-[30vh] bg-gradient-to-t from-[#F4F1EC] to-transparent z-40"></div>
      </motion.section>

      {/* Projects Content */}
      <div className="max-w-6xl mx-auto px-8 py-16 -mt-32 relative z-50">
        <div className="grid grid-cols-1 gap-12">
          {/* Branding Design Section */}
          <div className="bg-white rounded-lg p-8 border border-gray-200">
            <h2 className="text-4xl font-serif mb-6">Branding Design</h2>
            <div className="grid grid-cols-2 gap-6">
              <img 
                src="/branding1.png" 
                alt="Branding Design Example 1" 
                className="w-full rounded-lg"
              />
              <img 
                src="/branding2.png" 
                alt="Branding Design Example 2" 
                className="w-full rounded-lg"
              />
            </div>
            <p className="mt-4 text-gray-600">
              Some of my branding work for various clients, combining illustration and graphic design elements.
            </p>
          </div>

          {/* Web Game Design Section */}
          <div className="bg-white rounded-lg p-8 border border-gray-200">
            <h2 className="text-4xl font-serif mb-6">Web Game Design</h2>
            <div className="grid grid-cols-2 gap-6">
              <img 
                src="/echo-start.png" 
                alt="ECHO Game Start Screen" 
                className="w-full rounded-lg"
              />
              <img 
                src="/echo-gameplay.png" 
                alt="ECHO Game Gameplay" 
                className="w-full rounded-lg"
              />
            </div>
            <p className="mt-4 text-gray-600">
              "ECHO" is a web-based rhythm game created in 2024 that transforms sound into an interactive journey. Player's hits, skip, or react to music cues to create dynamic visuals and melodious intersections in a world shaped by moving beats.
            </p>
          </div>

          {/* Interactive Game Design Section */}
          <div className="bg-white rounded-lg p-8 border border-gray-200">
            <h2 className="text-4xl font-serif mb-6">Interactive Game Design</h2>
            <div className="grid grid-cols-1 gap-6">
              <img 
                src="/turkey-game.png" 
                alt="Little Turkey Adventure Game" 
                className="w-full rounded-lg"
              />
            </div>
            <p className="mt-4 text-gray-600">
              An interactive adventure game where players will make choices that affect the story's outcome. Help a little turkey can perform a jump or a double jump to avoid obstacles and collect items along the way. Collecting treats and local happenings, this game combines fun and exploration.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default OtherP;
